// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Crowdfunding {
    address public owner;
    uint256 public goal;
    uint256 public totalFunds;
    mapping(address => uint256) public contributions;

    event DonationReceived(address indexed donor, uint256 amount, uint256 totalFunds);
    event GoalReached(uint256 totalFunds);

    constructor(uint256 _goal) {
        owner = msg.sender;
        goal = _goal;
        totalFunds = 0;
    }

    function donate() public payable {
        require(msg.value > 0, "Donation must be greater than zero");
        
        contributions[msg.sender] += msg.value;
        totalFunds += msg.value;

        emit DonationReceived(msg.sender, msg.value, totalFunds);

        if (totalFunds >= goal) {
            emit GoalReached(totalFunds);
        }
    }

    function withdraw() public {
        require(msg.sender == owner, "Only owner can withdraw funds");
        require(totalFunds >= goal, "Funding goal not reached yet");
        
        payable(owner).transfer(address(this).balance);
    }
}

